import ResponsiveAppBar from './components/AppBar'
import LoginDiv from './components/Login'

function App() {
  return (
	<div className="container">
	  <ResponsiveAppBar></ResponsiveAppBar>
	  <br/>
	  <br/>
	  <LoginDiv></LoginDiv>
	</div>
  );
}

export default App;
